import 'dart:async';
import 'dart:convert';
import 'dart:html';
import 'package:spreadsheet/spreadsheet.dart';

final Map<String,String> files = {
  'default.ods':  '',
  'default.xlsx': '',
};

SpreadsheetDecoder decode(String filename) {
  return new SpreadsheetDecoder.decodeBytes(new Base64Decoder().convert(files[filename]));
}
